

<ul class="o-list-bare"><li class="o-list-bare__item">Similique voluptatum quia delectus natus expedita atque sunt qui.</li><li class="o-list-bare__item">Quae dicta nisi fugiat nostrum.</li><li class="o-list-bare__item">Aut non voluptatum non facere animi labore perferendis.</li><li class="o-list-bare__item">Et aliquid consequatur veritatis molestiae qui fuga assumenda.</li><li class="o-list-bare__item">Autem quisquam tenetur ipsa nihil et qui est provident.</li></ul>
